透明感の高いつややかな美肌に整える、CC効果の化粧下地です。<br>さまざまな色の光を放つ多偏光パールの効果で、くすみ・くま・ニキビ跡を自然にカバーします。<br>同時に肌をトーンアップして、メーク映えする美肌に見せる効果も。<br>☆アレルギーテスト済<br>☆ノンコメドジェニックテスト済<br>☆SPF30、PA＋＋<br>☆無香料<br><br>【使用方法】<br>●スキンケアで肌を整えた後、パール粒1コ分を目安にとり、顔全体にムラなくのばします。<br>●特に色ムラが気になる部位は、重ねづけしてください。<br>●落とすときは、メーククレンジングをお使いください。<br>●使用量が少ないと、十分な紫外線防御効果が得られません。<br><br>【使用上の注意】<br>◇目に入らないよう注意し、目に入ったときはすぐに洗い流してください。<br>◇ご使用後はチューブの口もとをきれいにふき、キャップをきちんと閉めてください。<br>◇日のあたるところや高温のところにおかないでください。<br>◇火気にご注意ください。<br>※商品のSPF表示及びPA表示は、国際SPF試験法に定められている塗布量平方センチメートルあたり2ミリグラムを皮ふに塗布して測定した結果です。<br><br><br>【広告文責】株式会社ワンステップ<br>TEL：0570-550-860<br>【メーカー名】資生堂ジャパン株式会社<br>【区分】日本製・化粧品<br><br>▼お届地域について<br>商品の配送区域は、日本国内に限らせて頂きます。<br>海外への発送は承っておりませんので、あらかじめご了承くださいませ。<br>※商品の性質などにより、一部お届け地域を制限させていただいている場合もございます。くわしくは各商品詳細画面にてご確認下さい。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：資生堂<br>シリーズ名：インテグレート<br>種類別名称：化粧下地<br>原産国：日本<br>SPF30<br>PA＋＋<br>無香料<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><img src=http://image.rakuten.co.jp/onestep/cabinet/life/cosme03/shiseido.jpg width=150><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4901872059454 KS2103 ks2103 資生堂 しせいどう シセイドウ SHISEIDO shiseido INTEGRATE integrate インテグレート ベースメイク ベースメーク 化粧品 化粧 メイク 化粧道具 メイク道具 CC CCクリーム 化粧下地 透明感 美肌 ミネラルベース ミネラル 偏光パール くすみ クマ くま ニキビ跡 にきび跡 カバー</font></td></tr></table><style type="text/css">
